/**
 * Compute the free vertices of the input graph.
 *
 * @param {any} graph - The input graph as a list of edges.
 * @returns {Iterable} The free vertices of the input graph.
 */
export default function freeVertices(graph) {
	const vertices = new Set(graph.left());
	for (const v of graph.right()) vertices.delete(v);
	return vertices;
}

export {default as freeVertices} from './freeVertices.js';
export {default as kahn1962} from './kahn1962.js';
export {default as sorted} from './sorted.js';
export {default as subroutine} from './subroutine.js';

/**
 * Kahn's algorithm for topological sorting.
 *
 * See https://en.wikipedia.org/wiki/Topological_sorting#CITEREFKahn1962
 *
 * @param {any} queue - Free vertices.
 * @param {any} graph - Edges of the graph.
 * @returns {Iterable<any>} The vertices in topological order.
 */
export default function* kahn1962(queue, graph) {
	while (true) {
		const u = queue.pop();
		if (u === undefined) break;
		yield u;
		for (const v of graph.rightOf(u)) {
			graph.delete([u, v]);
			if (graph.leftOf(v).next().done) {
				queue.push(v);
			}
		}
	}
}

import {PairingHeap as Heap} from '@aureooms/js-pairing-heap';
import {EfficientlyInvertiblePairs as Pairs} from '@aureooms/js-pairs';

import subroutine from './subroutine.js';

/**
 * Sort the vertices topologically breaking ties according to a given function.
 *
 * @param {Iterable<any>} edges - The input graph as a list of edges.
 * @param {Function} breakTies - The function to break ties.
 * @returns {Iterable<any>} The vertices sorted in topological order.
 * @throws {Error} If the input graph contains a cycle.
 */
export default function* sorted(edges, breakTies = undefined) {
	const queue = breakTies ? new Heap(breakTies) : [];
	const graph = Pairs.from(edges);

	yield* subroutine(queue, graph);

	if (graph.size > 0) {
		throw new Error(
			'@aureooms/js-topological-sorting#sorted: input graph contains a cycle',
		);
	}
}

import freeVertices from './freeVertices.js';
import kahn1962 from './kahn1962.js';

/**
 * Sort the vertices topologically using a queue to order the free vertices.
 *
 * @param {any} queue - The queue that will be used.
 * @param {any} graph - The input graph as a list of edges.
 * @returns {Iterable<any>} The vertices sorted in topological order.
 */
export default function subroutine(queue, graph) {
	for (const u of freeVertices(graph)) queue.push(u);
	return kahn1962(queue, graph);
}

